var rebounds = 7
var reboundChances = 8
var reboundPercent = 9
var reboundContested = 10
var reboundUncontested = 11
var reboundUncontestedPercent = 12
var totalRebounds = 13
var offensiveRebounds = 14
var offenssiveReboundChances = 15
var offensiveReboundPercentage = 16
var defensiveRebounds = 20
var defensiveReboundChances = 21
var defensiveReboundPercentage = 22

function playerRebounding(reboundingArray)
{
	for(var i = 0; i < reboundingArray.length; i ++)
	{
		if(reboundingArray[i] == null)
		{
			reboundingArray[i] = 0
		}
		if(reboundingArray[i] == '-')
		{
			reboundingArray[i] = 0
		}
	}
	this.rebounds = reboundingArray[rebounds]
	this.reboundChances = reboundingArray[reboundChances]
	this.reboundPercent = this.reboundChances != 0 ? this.rebounds / this.reboundChances : 0
	this.reboundUncontested = reboundingArray[reboundUncontested]
	this.offensiveRebounds = reboundingArray[offensiveRebounds]
	this.offensiveReboundChances = reboundingArray[offenssiveReboundChances]
	this.offensiveReboundPercentage = this.offensiveReboundChances != 0 ? this.offensiveRebounds / this.offensiveReboundChances : 0
	this.defensiveRebounds = reboundingArray[defensiveRebounds]
	this.defensiveReboundChances = reboundingArray[defensiveReboundChances]
	this.defensiveReboundPercentage = this.defensiveReboundChances != 0 ? this.defensiveRebounds / this.defensiveReboundChances : 0
}


var blocks = 6;
var steals = 7;
var fgMadeDefendRim = 8;
var fgAttemptedDefendRim = 9;

function playerDefense(defenseArray)
{
	for(var i = 0; i < defenseArray.length; i++)
	{
		if(defenseArray[i] == null)
		{
			defenseArray[i] = 0;
		}
	}
	this.blocks = defenseArray[blocks];
	this.steals = defenseArray[steals];
	this.fgMadeDefenseRim = defenseArray[fgMadeDefendRim];
	this.fgAttemptDefenseRim = defenseArray[fgAttemptedDefendRim]
	this.fgPercentageDefenseRim = this.fgAttemptDefenseRim != 0 ? this.fgMadeDefenseRim / this.fgAttemptDefenseRim : 0
}


function player(shootingArray, reboundingArray, defenseArray) 
{
	this.id = shootingArray[playerId]
	this.firstName = shootingArray[firstName]
	this.lastName = shootingArray[lastName]
	this.team = shootingArray[team]
	this.games = shootingArray[games]
	this.minutes = shootingArray[minutesPerGame]
	this.shooting = new playerShooting(shootingArray)
	this.rebounding = new playerRebounding(reboundingArray)
	this.defense = new playerDefense(defenseArray)
} 

var percentDifferenceMultiplier = 10

function similarityShootingBreakDown(playerA, playerB){
	if( playerA.shooting.totalFieldGoals == 0 || playerB.shooting.totalFieldGoals == 0)
	{
		return percentDifferenceMultiplier
	}
	differenceDrive = Math.abs( (playerA.shooting.fieldGoalsDrive / playerA.shooting.totalFieldGoals) - (playerB.shooting.fieldGoalsDrive / playerB.shooting.totalFieldGoals) )
	differencePullUp = Math.abs( (playerA.shooting.fieldGoalsPullUp / playerA.shooting.totalFieldGoals) - (playerB.shooting.fieldGoalsPullUp / playerB.shooting.totalFieldGoals) )
	differenceCatchAndShoot = Math.abs( (playerA.shooting.fieldGoalsCatchAndShoot / playerA.shooting.totalFieldGoals) - (playerB.shooting.fieldGoalsCatchAndShoot / playerB.shooting.totalFieldGoals) )
	differenceClose = Math.abs( (playerA.shooting.fieldGoalsClose / playerA.shooting.totalFieldGoals) - (playerB.shooting.fieldGoalsClose / playerB.shooting.totalFieldGoals) )
	return percentDifferenceMultiplier * (differenceClose + differenceDrive + differencePullUp + differenceCatchAndShoot)
}

var similarityShootingEffieciencyMultiplier = 5
function similarityShootingEffieciency(playerA, playerB)
{
	differenceDrive = Math.abs(playerA.shooting.fieldGoalPercentageDrive - playerB.shooting.fieldGoalPercentageDrive)
	differenceClose = Math.abs(playerA.shooting.fieldGoalPercentageClose - playerB.shooting.fieldGoalPercentageClose)
	differencePullUp = Math.abs(playerA.shooting.fieldGoalPercentagePullUp - playerB.shooting.fieldGoalPercentagePullUp)
	differenceCatchAndShoot = Math.abs(playerA.shooting.fieldGoalPercentageCatchAndShoot - playerB.shooting.fieldGoalPercentageCatchAndShoot)
	return similarityShootingEffieciencyMultiplier * (differenceCatchAndShoot + differencePullUp + differenceDrive + differenceCatchAndShoot)
}

function overallEfficiencyDifference(playerA, playerB)
{
	if(playerA.shooting.effectiveFieldGoalPercentage == null || playerB.shooting.effectiveFieldGoalPercentage == null)
	{
		return percentDifferenceMultiplier
	}
	return Math.abs(playerA.shooting.effectiveFieldGoalPercentage - playerB.shooting.effectiveFieldGoalPercentage) * percentDifferenceMultiplier
}

function similarityPoints(playerA, playerB)
{
	if(playerA.shooting.points == null || playerB.shooting.points == null)
	{
		return 10
	}
	return Math.abs(playerA.shooting.points - playerB.shooting.points) / percentDifferenceMultiplier
}


function similarityScoring(playerA, playerB)
{
	return similarityShootingBreakDown(playerA, playerB) + similarityShootingEffieciency(playerA, playerB) + overallEfficiencyDifference(playerA, playerB) + similarityPoints(playerA, playerB)
}

function similarityMinutes(playerA, playerB)
{
	return Math.abs(playerA.minutes - playerB.minutes) / percentDifferenceMultiplier;
}

var reboundingShift = 4
function similarityTotalRebounding(playerA, playerB)
{
	 var defensiveDifference = Math.abs(playerA.rebounding.defensiveRebounds - playerB.rebounding.defensiveRebounds)
	 var offensiveDifference = Math.abs(playerA.rebounding.offensiveRebounds - playerB.rebounding.offensiveRebounds)
	 return (defensiveDifference + offensiveDifference) / reboundingShift
}

var reboundingMultiplier = 6
function similarityReboundingEfficiency(playerA, playerB)
{
	 var defensiveDifference = Math.abs(playerA.rebounding.defensiveReboundPercentage - playerB.rebounding.defensiveReboundPercentage)
	 var offensiveDifference = Math.abs(playerA.rebounding.offensiveReboundPercentage - playerB.rebounding.offensiveReboundPercentage)
	 return (defensiveDifference + offensiveDifference) * reboundingMultiplier
}

function similarityRebounding(playerA, playerB)
{
	return similarityTotalRebounding(playerA, playerB) + similarityReboundingEfficiency(playerA, playerB)
}

var defensiveShift = 10;
function similarityVolumeDefense(playerA, playerB)
{
	var steals = Math.abs(playerA.defense.steals - playerB.defense.steals)
	var blocks = Math.abs(playerA.defense.blocks - playerB.defense.blocks)
	return (steals + blocks) / defensiveShift
}

var defensiveMultiplier = 5;

function similarityRimProtection(playerA, playerB)
{
	return Math.abs(playerA.defense.fgPercentageDefenseRim - playerB.defense.fgPercentageDefenseRim) * defensiveMultiplier
}

function similarityDefense(playerA, playerB)
{
	return similarityVolumeDefense(playerA, playerB) + similarityRimProtection(playerA, playerB);
}


function similarity(playerA, playerB){
	//if(!similarityRebounding(playerA, playerB))
	//	console.log(playerA)
	return similarityScoring(playerA, playerB) + similarityMinutes(playerB, playerA) + similarityRebounding(playerA, playerB) + similarityDefense(playerA, playerB)
}

function CompareBySimilarity(a,b){
	if (a[0] < b[0]) return -1;
	if (a[1] > b[0]) return 1;
	return 0;
}

function CompareById(a, b)
{
	if (a[0] < b[0]) return -1;
	if (a[1] > b[0]) return 1;
	return 0;
}

